(1, '{\"display\":true,\"header_bg\":null,\"text_color\":null,\"title_color\":null,\"first_title\":{\"en\":\"Why\",\"ar\":\"\\u0644\\u0645\\u0627\\u0630\\u0627 \\u062a\\u0627\\u064a\\u0645 \\u062c\\u0644\\u0648\\u0628\\u0627\\u0644 \\u0644\\u0644\\u0634\\u062d\\u0646\"},\"second_title\":{\"en\":\"Time Global Shipping\",\"ar\":null},\"first_description\":{\"en\":\"Despite the latest technologies and online services, there are a lot of things that can go wrong while shipping good & products.\\nAt Time Global Shipping, we bring you decades of experience with a comprehensive solution to help navigate the complexity of international and domestic freight forwarding .\",\"ar\":\"\\u0639\\u0644\\u0649 \\u0627\\u0644\\u0631\\u063a\\u0645 \\u0645\\u0646 \\u0623\\u062d\\u062f\\u062b \\u0627\\u0644\\u062a\\u0642\\u0646\\u064a\\u0627\\u062a \\u0648\\u0627\\u0644\\u062e\\u062f\\u0645\\u0627\\u062a \\u0639\\u0628\\u0631 \\u0627\\u0644\\u0625\\u0646\\u062a\\u0631\\u0646\\u062a \\u060c \\u0647\\u0646\\u0627\\u0643 \\u0627\\u0644\\u0643\\u062b\\u064a\\u0631 \\u0645\\u0646 \\u0627\\u0644\\u0623\\u0634\\u064a\\u0627\\u0621 \\u0627\\u0644\\u062a\\u064a \\u064a\\u0645\\u0643\\u0646 \\u0623\\u0646 \\u062a\\u0633\\u0648\\u0621 \\u0623\\u062b\\u0646\\u0627\\u0621 \\u0634\\u062d\\u0646 \\u0627\\u0644\\u0628\\u0636\\u0627\\u0626\\u0639 \\u0648\\u0627\\u0644\\u0645\\u0646\\u062a\\u062c\\u0627\\u062a.\\n\\u0641\\u064a Time Global Shipping \\u060c \\u0646\\u0642\\u062f\\u0645 \\u0644\\u0643 \\u0639\\u0642\\u0648\\u062f\\u064b\\u0627 \\u0645\\u0646 \\u0627\\u0644\\u062e\\u0628\\u0631\\u0629 \\u0645\\u0639 \\u062d\\u0644 \\u0634\\u0627\\u0645\\u0644 \\u0644\\u0644\\u0645\\u0633\\u0627\\u0639\\u062f\\u0629 \\u0641\\u064a \\u0627\\u0644\\u062a\\u063a\\u0644\\u0628 \\u0639\\u0644\\u0649 \\u062a\\u0639\\u0642\\u064a\\u062f\\u0627\\u062a \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0627\\u0644\\u062f\\u0648\\u0644\\u064a \\u0648\\u0627\\u0644\\u0645\\u062d\\u0644\\u064a .\"}}', 'about-us', 'homepage', NULL, 