(1, '{\"display\":true,\"header_bg\":null,\"text_color\":null,\"title_color\":null,\"title_1_whyus\":{\"en\":\"We cut complexity not conversations.\",\"ar\":\"\\u0646\\u062d\\u0646 \\u0646\\u0642\\u0637\\u0639 \\u0627\\u0644\\u062a\\u0639\\u0642\\u064a\\u062f \\u0648\\u0644\\u064a\\u0633 \\u0627\\u0644\\u0645\\u062d\\u0627\\u062f\\u062b\\u0627\\u062a.\"},\"description_1_whyus\":{\"en\":\"Because shipping is a complex process and stressful to monitor constantly, our customer support gives you a hand-on support throughout your shipping process.\",\"ar\":\"\\u0646\\u0638\\u0631\\u064b\\u0627 \\u0644\\u0623\\u0646 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0639\\u0645\\u0644\\u064a\\u0629 \\u0645\\u0639\\u0642\\u062f\\u0629 \\u0648\\u0645\\u0631\\u0647\\u0642\\u0629 \\u0644\\u0644\\u0645\\u0631\\u0627\\u0642\\u0628\\u0629 \\u0628\\u0627\\u0633\\u062a\\u0645\\u0631\\u0627\\u0631 \\u060c \\u064a\\u0645\\u0646\\u062d\\u0643 \\u062f\\u0639\\u0645 \\u0627\\u0644\\u0639\\u0645\\u0644\\u0627\\u0621 \\u0644\\u062f\\u064a\\u0646\\u0627 \\u062f\\u0639\\u0645\\u064b\\u0627 \\u0639\\u0645\\u0644\\u064a\\u064b\\u0627 \\u0637\\u0648\\u0627\\u0644 \\u0639\\u0645\\u0644\\u064a\\u0629 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0627\\u0644\\u062e\\u0627\\u0635\\u0629 \\u0628\\u0643.\"},\"title_2_whyus\":{\"en\":\"Best rates with no compromise.\",\"ar\":\"\\u0623\\u0641\\u0636\\u0644 \\u0627\\u0644\\u0623\\u0633\\u0639\\u0627\\u0631 \\u062f\\u0648\\u0646 \\u062d\\u0644 \\u0648\\u0633\\u0637.\"},\"description_2_whyus\":{\"en\":\"We don\\u2019t cut corners to save costs that can compromise the safety of your shipment. Instead rely on our strong relationships with carriers to negotiate the best rates .\",\"ar\":\"\\u0646\\u062d\\u0646 \\u0644\\u0627 \\u0646\\u0642\\u0637\\u0639 \\u0627\\u0644\\u0637\\u0631\\u064a\\u0642 \\u0644\\u062a\\u0648\\u0641\\u064a\\u0631 \\u0627\\u0644\\u062a\\u0643\\u0627\\u0644\\u064a\\u0641 \\u0627\\u0644\\u062a\\u064a \\u064a\\u0645\\u0643\\u0646 \\u0623\\u0646 \\u062a\\